char* get_path(time_t, pid_t);

int main(int argc, char** argv) {
    if (argc != 2) {
		puts("input something >:(");
        return EXIT_FAILURE;
    }

    char* flag = argv[1];

    char* path = get_path(time(NULL), getpid());        
	int fd = open(path, O_SYNC | O_WRONLY | O_CREAT, 0777);
	write(fd, filebytes, sizeof(filebytes) / sizeof(filebytes[0]));
	close(fd);

    pid_t id = fork();
    if (id == 0) {
        // Child
		sleep(1);
        execl(path, path, flag, NULL);
		perror("execl failed");
		return EXIT_FAILURE;
    } else {
        // Parent
		int status;
		if (waitpid(id, &status, 0) == -1) {
			perror("waitpid failed");
			return EXIT_FAILURE;
		}

		if (WIFEXITED(status) && WEXITSTATUS(status) ^ 1) {
			puts("yupp that's the flag");
		} else {
			puts("not the flag :(");
		}

		remove(path);

		return EXIT_SUCCESS;
    }

	return EXIT_SUCCESS;
}

char* get_path(time_t t, pid_t p) {
    char* dir = (char *) malloc(PATH_MAX);
    ssize_t len = readlink("/proc/self/cwd", dir, PATH_MAX - 1);

    if (len == -1) {
        return "";
    }

	char name[PATH_MAX];
	int name_len = sprintf(name, "/dont_look_%d_%d", (int)t, p);
	name[name_len] = '\0';

	strcpy(dir + len, name);
	len += name_len;
    dir[len] = '\0';

    return dir;
}


